export class Patients{

    id : number;
	firstname:String;
	lastname:String;
	email:String;
	mobileno:number;

    constructor(){
        this.id = 0;
        this.firstname = "";
        this.email="";
        this.lastname="";
        this.mobileno=0;
    }
}
